import React from 'react';
import TextField from '@mui/material/TextField';

import './styles/SignIn.css';

const SignIn = ({ handleSubmit, handleSignUp }) => {
    const userRef = React.useRef();
    const passRef = React.useRef();

    const onSubmitClick = () => {
        handleSubmit(userRef.current.value, passRef.current.value);
    }

    const onSignUpClick = () => {
        handleSignUp(userRef.current.value, passRef.current.value);
    }

    return (
        <div className="SignIn">
            <div>
                <TextField ref={userRef} variant="outlined" label="email"/>
            </div>
            <div>
                <TextField ref={passRef} variant="outlined" label="password"/>
            </div>
            <button onClick={onSubmitClick}>Submit</button>
            <button onClick={onSignUpClick}>Sign Up</button>
        </div>
    );
}

export default SignIn;
